idx=0
for project in fw.projects():
    print('%s: %s' % (project.id, project.label))
    if project.label != 'RBC_HBN':
        continue

    for subject in project.subjects():
        #if subject.label == 'sub-NDARFR820KFF':
        #if "sub-NDAR" in subject.label:
        if subject.label in allsub:

            print('%s: %s' % (subject.id, subject.label))
            idx += 1
            for session in subject.sessions():
                print('%s: %s' % (session.id, session.label))
              
                # NDARYA955CY1_ses
                # for func
                func_intend_list=[] # initilized the emplty list
                for acquisition in session.acquisitions():
                    if 'task' in acquisition.label:
                        if len(acquisition.files) != 0:
                            filename=session.label + '/func/' + acquisition.files[0]['name']
                            func_intend_list.append(filename)

                # fow dwi
                dwi_intend_list=[] # initilized the emplty list
                for acquisition in session.acquisitions():
                    if 'acq-64dir_dwi' in acquisition.label:
                        for i in acquisition.files:
                            if 'nii.gz' in i.name:
                                filename=session.label + '/dwi/' + i.name
                                dwi_intend_list.append(filename)


                for acquisition in session.acquisitions():
                    # fmri
                    if acquisition.label=='acq-fMRI_dir-PA_epi' or acquisition.label =='acq-fMRI_dir-AP_epi' or acquisition.label=='dir-PA_acq-fMRI_epi' or acquisition.label =='dir-AP_acq-fMRI_epi' or 'magnitude' in acquisition.label or 'phasediff' in acquisition.label:
                        if len(acquisition.files) != 0:
                            acquisition.update_file_info(acquisition.files[0].name, {'IntendedFor': func_intend_list})
                            print('%s: %s' % (acquisition.id, acquisition.label))

                    # dwi
                    if acquisition.label=='acq-dwi_dir-PA_epi' or acquisition.label =='acq-dwi_dir-AP_epi' or acquisition.label=='dir-PA_acq-dwi_epi' or acquisition.label =='dir-AP_acq-dwi_epi':
                        if len(acquisition.files) != 0:
                            acquisition.update_file_info(acquisition.files[0].name, {'IntendedFor': dwi_intend_list})
                            print('%s: %s' % (acquisition.id, acquisition.label))




